import React from 'react';
import {Link} from 'react-router-dom';
import "./loding-css.css"

const Loding = () =>{
    return(
        <div className="loding-parent">
        <div className="loding-page">
            <div className="image-section">
                <img className="team-image" src="data:image/png;base64," alt="Loding..."/>
            </div>
            <div className="enter-section">
                <h2 className="x-heading">10X team 08</h2>
                <p className='text-font'>CodeAlong best pay after placement</p>
                <Link to="/posts"><button className="enter-button">Enter</button></Link>
                
            </div>
        </div>
        </div>
    )
}
export default Loding
